import React from 'react';
// import ReactDOM from 'react-dom/client';
import image from '../pic.jpg';
import "./card.scss";
// import EmailIcon from '@mui/icons-material/Email';
// import LinkedInIcon from '@mui/icons-material/LinkedIn';

export default function Card(){
    return (
        <div className='container'>
            <div className='box'>
                <div className='card'>
                    <img className='pic' src={image} width="275px" height="230px"/>
                    <div className='title'>
                        <h3 className='name'>Harsh Jain</h3>
                    </div>
                    <div className='title1'>
                        <h5 className='designation'>Software Engineer</h5>
                    </div>
                    <div className='buttons'>
                        {/* <EmailIcon/> */}
                        <button className='email'>Email</button>
                        {/* <LinkedInIcon/> */}
                        <button onclick="window.open('https://www.linkedin.com/in/hsjain/')" className='linkedin'>LinkedIn</button>
                    </div>
                    <div className='about'>
                        <h4 className="title"> About </h4>
                        <p className='about-desc'>
                            Recent UMass Amherst Computer Science graduate with a BS degree and a 3.94 GPA (magna cum laude). Skilled in Python, MySQL, JavaScript, React, and Node. Experience includes two internships in software and data-related fields. Seeking full-time opportunities in the software and data field.
                        </p>
                    </div>
                    <div className='interest'>
                        <h4 className="title"> Interests </h4>
                        <p className='interest-desc'>
                            Web Development, Data Science, Business Analytics, Trading, Sports and Photography
                        </p>
                    </div>
                    <div className='foot'>
                        <footer className='icons'>
                            email: harshjain@gmail.com 2001
                        </footer>
                    </div>
                </div>
            </div>
        </div>
    )
}
